import LinkEditor from "../LinkEditor/LinkEditor";
import AddOrEditLink from "../AddOrEditLink/AddOrEditLink";
import "./LinkEditorCard.css";

const LinkEditorCard = ({ links, title, setAddedLinks, updateLinks, addLink }) => {
  return (
    <div className="editor-card-wrapper">
      <div>{title}</div>
      {links.map(
        (link) =>
          link.title &&
          link.url && (
            <LinkEditor
              key={link.id}
              link={link}
              setAddedLinks={setAddedLinks}
              updateLinks={updateLinks}
            />
          )
      )}
      <AddOrEditLink setAddedLinks={setAddedLinks} addOrEdit={"add"} addLink={addLink}/>
    </div>
  );
};

export default LinkEditorCard;
